import AndroidDev from "Android_Dev.jpg";
import Marketing from "Marketing.jpg";

const Sdata = [
  {
    imgsrc: WebDev,
    title: "Web Development",
  },
  {
    imgsrc: AppDev,
    title: "App Development",
  },
  {
    imgsrc: SoftwareDev,
    title: "Software Development",
  },
  {
    imgsrc: DigiMark,
    title: "Digital Marketing",
  },
  {
    imgsrc: Marketing,
    title: "Android Development",
  },
  {
    imgsrc: Marketing,
    title: "Marketing",
  },
];

